import styled from 'styled-components'; 
export const Button = styled.div`
   position: fixed; 
   width: 100%;
   left: 92%;
   bottom: 100px;
   height: 20px;
   font-size: 3rem;
   z-index: 10;
   cursor: pointer;
   color: rgb(218,119,30);
`
